import React,{useState} from "react";

function Demo1() {
  const [count, setCount] = useState(10);
  const [name, setName] = useState("");

  function kajal(){
    setCount(count+1);
  }

  return (
    <div>
      <div>
        <button onClick={kajal} className="bg-red-500 p-5 rounded-full text-center">
          Click me
        </button>
        {count}
      </div>
      <div>name</div>
      <input type="text" className="bg-blue-500" onChange={(e)=>setName(e.target.value)}></input>
      <div className="bg-green-500">{name}</div>
    </div>
  );
}

export default Demo1;
